import React from "react";
import { Button } from "antd";

import "./index.less";

function Home() {
  return (
    <div className="page-wrapper">
      <div className="header">This is the header</div>
      <div className="main-wrapper">
        <div className="section-header">1</div>
        <div className="section-partner">2</div>
        <div className="section-explore">3</div>
        <div className="section-why-sauwallet">4</div>
        <div className="section-assets">5</div>
        <div className="section-cta">
          <div className="sub-title">
            Get the Love Lock Ring To Show Your Commitment
          </div>
          <div className="description">
            We take environment seriously and so should you. Screw diamonds
          </div>
          <Button type="primary"> Try it </Button>
        </div>
      </div>
    </div>
  );
}

